class Solution1(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        result = 0
        length = s.__len__()
        if length < 2 :
            return length
        for i in range(length-1):
            for j in range(i, length):
                if s[j] not in s[i:j]:
                    if (j - i + 1) > result:
                        result = j - i + 1
                else:
                    break
            if result >= (length - i - 1) :
                return result

"""
优化方法，利用窗口原理节省计算时间
"""
class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        if not s:
            return 0
        length = len(s)
        lookup = list()
        max_len = 0
        current_len = 0
        for i in range(length):
            value = s[i]
            if value not in lookup:
                lookup.append(value)
                current_len += 1
            else:
                index = lookup.index(value)
                lookup = lookup[index+1:]
                lookup.append(value)
                current_len = len(lookup)
            if current_len > max_len:
                max_len = current_len
        return max_len

